import React, { Component } from 'react'

import ReactPlayer from 'react-player';
import ProgressBar from './ProgressBar';

export default class YoutubeFooter extends Component {

    state = {
        playing : false
    }

    render() {
        var {title, author, url} = this.props
        return (
            <div style = {{
                height: 200, 
                width: '100%', 
                backgroundColor: 'white', 
                position: 'fixed', 
                bottom: 0,
                display: 'flex',
                flexDirection: 'row'}}>

                <ReactPlayer 
                    url={url}
                    width = {200}
                    height = {200}
                    playing = {this.state.playing}
                    onReady = {() => console.log("Ready")}/>

                <div>
                    <h5>{title}</h5>
                    <h6>{author}</h6>
                </div>

                <i style = {{fontSize: 100}} class="material-icons">play_arrow</i>
                <ProgressBar 
                    width = {400} 
                    height = {40} 
                    progress = {0.6}
                    completedBarColor = "#8f8f8f"
                    notCompletedBarColor = "#d1d1d1"
                    cursorColor = "#292929"/>
            </div>
        )
    }
}
